import styles from './Navbar.module.css';
import icon_five from '../../assets/icons/cash.svg'

function Navbar() {
    return (
        <div className={styles.Navbar}>
            <div className={styles.container}>
                <img className={styles.img} src={icon_five} />
            </div>
        </div>
    );
}

export default Navbar;
